import React from "react";
import "./App.css";
import Header from "./components/Header";
import styled from "styled-components";
import { Navigation } from "./components/Navigation";

function App() {
  const MainWrapper = styled.div`
    display: flex;
    gap: 3rem;
  `;

  return (
    <div className="App">
      <Header />
      <MainWrapper>
        <Navigation />
        <div>
          Lorem ipsum dolor sit amet consectetur, adipisicing elit. Est
          accusamus labore doloribus repellendus voluptatem ex magni dignissimos
          reprehenderit vero, reiciendis numquam, sunt neque iure earum nemo
          deserunt nihil voluptates ipsum officiis aspernatur hic laudantium.
          Vitae, quae velit illum corporis, obcaecati magni ut facere dicta
          accusantium iste inventore dolores labore amet, alias veniam
          aspernatur iure! Porro omnis corrupti fugit facilis beatae
          necessitatibus ab, cupiditate esse voluptates quaerat dolor ipsa
          veniam sunt non quidem ducimus odio. Suscipit omnis rem fugit nam
          quisquam numquam excepturi cumque nihil praesentium cum veritatis
          laudantium reiciendis quasi at, earum nemo facere autem tenetur, odit
          a, voluptate inventore!
        </div>
      </MainWrapper>
    </div>
  );
}

export default App;
